import { useContext } from "react";
import Navbar from "../components/NavbarC";
import Patient from "../components/PatientC";
import { PatientStateContext } from "../App";
import Patientdetails from "../components/Patientdetail";

const Home = () => {
  const patientlist = useContext(PatientStateContext);
  const patienttestinfo = {
    patientName: "김영찬",
    gender: "남",
    age: 25,
    reservationDate: "2023-09-30T11:00:00",
    symptoms: "의료기기 교체",
    height: 170,
    weight: 70,
    Accumulatednumber: 3,
    distance: "13km",
    callnumber: "010-1234-5667",
    birthday: "2000-01-01",
  };
  return (
    <div className="container">
      <Navbar />
      <div className="chart">
        <div className="chartheader">
          <span>차트</span>
        </div>
        <div className="patient-list">
          <h3>환자 리스트</h3>
          <button>예약 신청 {patientlist.length}</button>
          <button>예약 완료</button>
          <button>진료 완료</button>
          <div>
            {patientlist.map((it) => (
              <Patient {...it} />
            ))}
          </div>
        </div>
        <div className="patient-detail-info">
          <Patientdetails />
        </div>
      </div>
    </div>
  );
};

export default Home;
